import React from 'react';
import axios from 'axios';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import courses from './data/courses.json';
import terms from './data/terms.json';

import './App.css';			

class App extends React.Component {

  constructor(props){
	  super(props);
  }

  handleClick(e) {
	  e.preventDefault();
	  axios.get('')
	    .then(res => console.log(res));
  }

  render(){
    //const courses = courses.map(course);
    var terms = terms.map((term) => {return (<option key={term.id}>{term.name}</option>); });

	  return(
	    <Container className="p-3">
		    <Jumbotron>
		      <h3>Which courses do you want?</h3>

		      <Form>
			      <Form.Group as={Row} controlId="term">
			        <Form.Label column sm={1}>Term</Form.Label>
			        <Col sm={4}>
				        <Form.Control as="select" column sm={12}>
				          <option></option>
                  {terms}
				        </Form.Control>
			        </Col>
			      </Form.Group>

			      <Form.Group as={Row} controlId="time">
			        <Form.Label column sm={1}>Time</Form.Label>
			        <Col sm={4}>
				        <Form.Control as="select">
				          <option></option>
				          <option>Fall Term 2020</option>
				          <option>Winter Term 2021</option>
				        </Form.Control>
			        </Col>
			      </Form.Group>

			      <Form.Group as={Row} controlId="course_name">
			        <Form.Label column sm={1}>Course Name</Form.Label>
			        <Col sm={4}>
				        <Form.Control as="select">
				          <option></option>
				        </Form.Control>
			        </Col>
			      </Form.Group>

			      <Button onClick={this.handleClick} variant="primary" type="submit">Submit</Button>

		      </Form>

		    </Jumbotron>
	    </Container>
	  );
  }

}

export default App;
